actionConfiguration.body:
() => {
	//	showAlert(appsmith.store.vayCountryofRegistration  + "123"+appsmith.store.vayApplicationIndConstitutionType)
		if ( appsmith.store.vayCountryofRegistration === "IN")
		{
			if(appsmith.store.vayApplicationIndConstitutionType === "LLP" || 
				 appsmith.store.vayApplicationIndConstitutionType === "Public Limited Company" ||
				 appsmith.store.vayApplicationIndConstitutionType === "LLC" || appsmith.store.vayApplicantRole==='Financier')
			{
				return navigateTo('India Corporate Address',{});
			}
			else
			{
	 			return navigateTo('India Non Corporate Address',{});
			}	
		}
		else
		{
			return navigateTo('Foreign Business Address',{});

		}
}

